INSERT INTO `notice_board` VALUES ('32', '关于举办2017年嘉兴市非奥运动项目健美健身培训班的通知', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\"><span style=\"mso-spacerun:\'yes\';font-family:方正小标宋简体;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';color:rgb(255,0,0);letter-spacing:16.0000pt;font-size:36.0000pt;mso-font-kerning:1.0000pt;\">嘉兴市体育局</span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\"><span style=\"color: rgb(255, 0, 0); font-family: 宋体; font-size: 10.5pt;\">&nbsp;</span></p><p class=\"MsoNormal\"><span style=\"mso-spacerun:\'yes\';font-family:\'Times New Roman\';mso-fareast-font-family:宋体;color:rgb(255,0,0);font-size:10.5000pt;mso-font-kerning:1.0000pt;\">&nbsp;</span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:33.0000pt;mso-line-height-rule:exactly;\"><b><span style=\"font-family: 方正小标宋简体; font-size: 22pt;\"><font face=\"方正小标宋简体\">关于举办</font>2017年嘉兴市非奥运动项目</span></b><b><span style=\"font-family: 方正小标宋简体; font-size: 22pt;\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:33.0000pt;mso-line-height-rule:exactly;\"><b><span style=\"font-family: 方正小标宋简体; font-size: 22pt;\">健美健身培训班的通知</span></b><b><span style=\"font-family: 黑体; font-size: 22pt;\"><o:p></o:p></span></b></p><p class=\"MsoBodyText\" style=\"layout-grid-mode:char;line-height:33.0000pt;mso-line-height-rule:exactly;\"><b><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"line-height:150%;\"><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\">南湖区、秀洲区、经开区教文体局，各有关单位：</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent: 32.25pt; line-height: 150%;\"><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:Tahoma;mso-bidi-font-family:Tahoma;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\">为进一步加快</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:Tahoma;mso-bidi-font-family:Tahoma;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\">健美健身</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:Tahoma;mso-bidi-font-family:Tahoma;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><font face=\"仿宋_GB2312\">项目的普及，推广科学健美健身新方法，结合今年嘉兴市非奥运动项目培训基地年度培训计划，将于</font>6月下旬举办2017年嘉兴市非奥运动项目健美健身培训班。现将有关事</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\">项通知如下：</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:-36.0000pt;mso-para-margin-left:-3.4300gd;text-indent:72.0000pt;mso-char-indent-count:4.5000;line-height:150%;\"><b><span style=\"font-family: 仿宋_GB2312; line-height: 150%; font-size: 16pt;\">一、培训时间、地点</span></b><b><span style=\"font-family: 仿宋_GB2312; line-height: 150%; font-size: 16pt;\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;mso-char-indent-count:2.0000;line-height:150%;\"><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\"><font face=\"仿宋_GB2312\">（一）培训时间：</font>6月23日 18:30-21:30</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\">&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\">；</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;mso-char-indent-count:2.0000;line-height:150%;\"><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\">（二）培训地点：</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:Tahoma;mso-bidi-font-family:Tahoma;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><font face=\"仿宋_GB2312\">嘉兴市嘉信健身健美培训中心（嘉兴市南湖区中山东路</font>173号 工人文化宫内）</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\">&nbsp;<font face=\"仿宋_GB2312\">。</font></span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:-36.0000pt;mso-para-margin-left:-3.4300gd;text-indent:72.0000pt;mso-char-indent-count:4.5000;line-height:150%;\"><b><span style=\"font-family: 仿宋_GB2312; line-height: 150%; font-size: 16pt;\">二、培训内容</span></b><b><span style=\"font-family: 仿宋_GB2312; line-height: 150%; font-size: 16pt;\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;mso-char-indent-count:2.0000;line-height:26.0000pt;mso-line-height-rule:exactly;\"><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;mso-font-kerning:1.0000pt;\">（一）健美健身器械训练指导技巧；</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;mso-font-kerning:1.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;mso-char-indent-count:2.0000;line-height:26.0000pt;mso-line-height-rule:exactly;\"><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;mso-font-kerning:1.0000pt;\">（二）健美健身锻炼计划制定原理与方法；</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;mso-font-kerning:1.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;mso-char-indent-count:2.0000;line-height:26.0000pt;mso-line-height-rule:exactly;\"><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;mso-font-kerning:1.0000pt;\">（三）健美健身运动风险防范的措施。</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;mso-font-kerning:1.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;mso-char-indent-count:2.0000;line-height:150%;\"><b><span style=\"font-family: 仿宋_GB2312; line-height: 150%; font-size: 16pt;\">三、培训对象</span></b><b><span style=\"font-family: 仿宋_GB2312; line-height: 150%; font-size: 16pt;\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-indent: 32pt; line-height: 150%;\"><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:Tahoma;mso-bidi-font-family:Tahoma;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><font face=\"仿宋_GB2312\">健身健身爱好者（</font>50名）。</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:Tahoma;mso-bidi-font-family:Tahoma;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent: 32pt; line-height: 150%;\"><b><span style=\"font-family: 仿宋_GB2312; line-height: 150%; font-size: 16pt;\">四、培训老师</span></b><b><span style=\"font-family: 仿宋_GB2312; line-height: 150%; font-size: 16pt;\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-indent: 32pt; line-height: 150%;\"><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:Tahoma;mso-bidi-font-family:Tahoma;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><font face=\"仿宋_GB2312\">国际健美大师、国际健美冠军、中国健美协会等级健身指导员教师</font>——边秋蔚。</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:Tahoma;mso-bidi-font-family:Tahoma;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent: 32pt; line-height: 150%;\"><b><span style=\"font-family: 仿宋_GB2312; line-height: 150%; font-size: 16pt;\">五、培训相关费用</span></b><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent: 33.6pt; line-height: 150%;\"><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:Tahoma;mso-bidi-font-family:Tahoma;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\">培训资料、场地、器材由组织方提供，交通费自理。</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:Tahoma;mso-bidi-font-family:Tahoma;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent: 33.6pt; line-height: 150%;\"><b><span style=\"font-family: 仿宋_GB2312; line-height: 150%; font-size: 16pt;\">六、有关要求</span></b><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent: 31.5pt; line-height: 150%;\"><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:Tahoma;mso-bidi-font-family:Tahoma;line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\">（一）通过市体育局微信公众号公开报名</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><font face=\"仿宋_GB2312\">，按先后顺序报满</font>50人截止。市体育局群体处联系人：孙聪，电话：89976395。</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0000pt;mso-char-indent-count:2.0000;line-height:150%;\"><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\">（二）请报名成功的</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\"><font face=\"仿宋_GB2312\">参训人员自带运动服和鞋于</font>6月23日18：10前到</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:Tahoma;mso-bidi-font-family:Tahoma;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><font face=\"仿宋_GB2312\">嘉兴市嘉信健身健美培训中心（嘉兴市南湖区中山东路</font>173号 工人文化宫内）</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\">&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:Tahoma;mso-bidi-font-family:Tahoma;line-height:150%;font-size:16.0000pt;mso-font-kerning:0.0000pt;\">报到</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\">。</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height:150%;\"><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:240.0000pt;mso-char-indent-count:15.0000;line-height:150%;\"><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\">&nbsp;</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:240.0000pt;mso-char-indent-count:15.0000;line-height:150%;\"><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\">&nbsp;<font face=\"仿宋_GB2312\">嘉兴市体育局</font></span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;font-size:16.0000pt;mso-font-kerning:1.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:296.0000pt;mso-char-indent-count:18.5000;\"><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:Tahoma;mso-bidi-font-family:Tahoma;font-size:16.0000pt;mso-font-kerning:0.0000pt;\">2017年6月15日</span><span style=\"mso-spacerun:\'yes\';font-family:仿宋_GB2312;mso-hansi-font-family:Tahoma;mso-bidi-font-family:Tahoma;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p>', null, '2017-06-16 09:47:35', '', '10', '15');
INSERT INTO `notice_board` VALUES ('39', '嘉兴市第五届市民运动会—活力展现运动汇轮滑比赛 补充通知', '<p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:125%\"><span style=\"font-size:15.0pt;line-height:125%;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">各参赛单位：<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:125%\"><span lang=\"EN-US\" style=\"font-size:15.0pt;line-height:125%;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">2017</span><span style=\"font-size:15.0pt;line-height:125%;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">嘉兴市第五届市民运动会<span lang=\"EN-US\">—</span>活力展现运动汇轮滑比赛将于<st1:chsdate year=\"2017\" month=\"9\" day=\"15\" islunardate=\"False\" isrocdate=\"False\" w:st=\"on\"><span lang=\"EN-US\">9</span>月<span lang=\"EN-US\">15</span>日</st1:chsdate>至<span lang=\"EN-US\">17</span>日在浙江师范大学附属秀洲实验学校（轮滑场）举行。经报主办单位同意，现将有关事项补充通知如下：<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.1pt;mso-char-indent-count:2.0\"><b><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">一、报到时间、地点与要求</span></b><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:125%\"><span style=\"font-size:15.0pt;line-height:125%;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">（一）运动队报到与适应场地时间、地点：<st1:chsdate year=\"2017\" month=\"9\" day=\"15\" islunardate=\"False\" isrocdate=\"False\" w:st=\"on\"><span lang=\"EN-US\">9</span>月<span lang=\"EN-US\">15</span>日</st1:chsdate>，<span lang=\"EN-US\">8</span>：<span lang=\"EN-US\">00--- 19</span>：<span lang=\"EN-US\">00</span>之间，报到地点：浙江师范大学附属秀洲实验学校（浚源楼一楼大观堂教室）。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:125%\"><span style=\"font-size:15.0pt;line-height:125%;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">裁判员报到时间、地点：<st1:chsdate year=\"2017\" month=\"9\" day=\"15\" islunardate=\"False\" isrocdate=\"False\" w:st=\"on\"><span lang=\"EN-US\">9</span>月<span lang=\"EN-US\">15</span>日</st1:chsdate>，晚上<span lang=\"EN-US\">19</span>：<span lang=\"EN-US\">30</span>前，报到地点：浙江师范大学附属秀洲实验学校（浚源楼一楼大观堂教室）。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:125%\"><span style=\"font-size:15.0pt;line-height:125%;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">（二）大会不安排食宿，各代表队请于报到时预购比赛当天的午餐，每人每餐<span lang=\"EN-US\">30</span>元。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">（三）报到时请各代表队交验运动员本人二代身份证原件或户口本原件、有资质的医疗单位出具的运动员健康证明、赛事期间的运动员意外伤害保险单复印件和自愿参赛责任书。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"margin-left:66.1pt;text-indent:-36.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">二、<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;</span></span><!--[endif]--><b><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">竞赛安排</span></b><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0\"><st1:chsdate year=\"2017\" month=\"9\" day=\"15\" islunardate=\"False\" isrocdate=\"False\" w:st=\"on\"><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体; mso-font-kerning:0pt\">9</span><span style=\"font-size:15.0pt;font-family:宋体; mso-bidi-font-family:宋体;mso-font-kerning:0pt\">月<span lang=\"EN-US\">15</span>日</span></st1:chsdate><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">晚上<span lang=\"EN-US\">19</span>：<span lang=\"EN-US\">00</span>领队、教练、裁判员联席会议。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><st1:chsdate year=\"2017\" month=\"9\" day=\"16\" islunardate=\"False\" isrocdate=\"False\" w:st=\"on\"><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体; mso-font-kerning:0pt\">9</span><span style=\"font-size:15.0pt;font-family:宋体; mso-bidi-font-family:宋体;mso-font-kerning:0pt\">月<span lang=\"EN-US\">16</span>日</span></st1:chsdate><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">全天比赛<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><st1:chsdate year=\"2017\" month=\"9\" day=\"17\" islunardate=\"False\" isrocdate=\"False\" w:st=\"on\"><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体; mso-font-kerning:0pt\">9</span><span style=\"font-size:15.0pt;font-family:宋体; mso-bidi-font-family:宋体;mso-font-kerning:0pt\">月<span lang=\"EN-US\">17</span>日</span></st1:chsdate><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">全天比赛；颁奖。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">根据实际报名情况，若有调整，请各代表队领队教练加入<span lang=\"EN-US\">QQ</span>群<span lan