INSERT INTO `notice_board` VALUES ('45', '关于举办2017年全市科学健身大讲堂的 通  知', '<p class=\"MsoNormal\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">各县（市、区）体育局（教文体局），体育总会，各级社团：<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">为进一步普及科学健身知识，提高市民科学健身技能，经研究，决定举办<span lang=\"EN-US\">2017</span>年全市科学健身大讲堂，现将有关事宜通知如下：<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:16.0pt;font-family:黑体;mso-hansi-font-family:宋体\">一、时间、地点<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">时间：第一期<span lang=\"EN-US\">8</span>月<span lang=\"EN-US\">12</span>日、第二期</span><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">9</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">月<span lang=\"EN-US\">16</span>日；</span><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">地点：</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">嘉兴国际网球中心、嘉兴学院。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:16.0pt;font-family:黑体;mso-hansi-font-family:宋体\">二、参加对象<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">（一）相关协会、社团体育工作者；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">（二）全市体育健身爱好者。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:16.0pt;font-family:黑体;mso-hansi-font-family:宋体\">三、培训内容安排<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:新宋体;mso-bidi-font-family:宋体;color:black;mso-font-kerning:0pt\">（一）</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">董晓虹（浙江大学体艺部教授<span lang=\"EN-US\">,</span>浙江大学运动人体科学硕士研究生导师）<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:28.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:新宋体;mso-bidi-font-family:宋体;color:black;mso-font-kerning:0pt\">主题：</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">全民健身，科学锻炼方法。</span><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-bidi-font-family:宋体;color:black;mso-font-kerning:16.0pt\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">（二）尤玲华（杭州尤看运动医学诊所院长，副主任医师）<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">主题：网球运动常见运动损伤预防及康复训练。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 30.1pt; line-height: 18.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:16.0pt;font-family:黑体;mso-hansi-font-family:新宋体;mso-bidi-font-family:宋体;color:black;mso-font-kerning:0pt;mso-bidi-font-weight:bold\">四、相关事宜<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 30pt; line-height: 18.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:新宋体;mso-bidi-font-family:宋体;color:black;mso-font-kerning:0pt\">（一）参加培训人员的交通费自理，其他费用由市体育科学学会承担。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 30pt; line-height: 18.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:新宋体;mso-bidi-font-family:宋体;color:black;mso-font-kerning:0pt\">（二）请关注“动感禾城”微信公众号<span lang=\"EN-US\">-</span>在菜单栏中选择赛事管理<span lang=\"EN-US\">-</span>群体赛事<span lang=\"EN-US\">-2017</span>年全面健身公益大培训科学健身大讲堂。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 30pt; line-height: 18.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:新宋体;mso-bidi-font-family:宋体;color:black;mso-font-kerning:0pt\">&nbsp;</span></p><p class=\"MsoNormal\" align=\"right\" style=\"text-align:right;text-indent:33.0pt\"><span lang=\"EN-US\" style=\"mso-bidi-font-size:10.5pt;font-family:宋体\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<o:p></o:p></span></p><p class=\"MsoNormal\" align=\"right\" style=\"margin-right:7.75pt;text-align:right;text-indent:33.0pt\"><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">&nbsp;</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">嘉兴市体育科学学会<span lang=\"EN-US\"><o:p></o:p></span></span></p><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-font-kerning:1.0pt;mso-ansi-language:EN-US;mso-fareast-language:ZH-CN;mso-bidi-language:AR-SA\">2016</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-font-kerning:1.0pt;mso-ansi-language:EN-US;mso-fareast-language:ZH-CN;mso-bidi-language:AR-SA\">年<span lang=\"EN-US\">7</span>月<span lang=\"EN-US\">24</span>日</span>', '0607c453-89ef-4668-84f2-229288cf6051-', '2017-08-01 11:38:18', null, '2', '33');
INSERT INTO `notice_board` VALUES ('47', '2017年嘉兴市全民健身篮球公益培训方案', '<p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 31.35pt;\"><span style=\"font-size:16.0pt;font-family:黑体;mso-hansi-font-family:宋体\">一、活动背景<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">为了纪念北京奥运会成功举办，经国务院批准，自<span lang=\"EN-US\">2009</span>年起，每年<span lang=\"EN-US\">8</span>月<span lang=\"EN-US\">8</span>日为“全民健身日”。今年<span lang=\"EN-US\">8</span>月<span lang=\"EN-US\">8</span>日正值第十三届全运会举办前夕，为落实全民健身国家战略、倡导文明健康生活方式、促进全民健身与全民健康深度融合，根据嘉兴市体育局的“全民健身公益大培训”计划，特制定此次活动方案。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 31.35pt;\"><span style=\"font-size:16.0pt;font-family:黑体;mso-hansi-font-family:宋体\">二、活动主题<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">全民篮球，你我同行。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 31.35pt;\"><span style=\"font-size:16.0pt;font-family:黑体;mso-hansi-font-family:宋体\">三、活动概况<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">活动时间：<span lang=\"EN-US\">2017</span>年<span lang=\"EN-US\">8</span>月<span lang=\"EN-US\">7</span>日<span lang=\"EN-US\">-8</span>月<span lang=\"EN-US\">10</span>日；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">活动地点：万达广场（室内）；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">主办单位：嘉兴市体育局；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">承办单位：浙江超梦体育文化有限公司；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">培训内容：篮球基本技术培训、花式篮球培训、篮球啦啦操教学。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 31.35pt;\"><span style=\"font-size:16.0pt;font-family:黑体;mso-hansi-font-family:宋体\">四、执行计划<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span lang=\"EN-US\" style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">1</span><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">、报名组织：通过“文化有约”平台、嘉兴市体育局微信公众号“动感禾城”等发布信息，接受市民报名。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span lang=\"EN-US\" style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">2</span><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">、场地搭建：<span lang=\"EN-US\">8</span>月<span lang=\"EN-US\">1</span>日<span lang=\"EN-US\">-8</span>月<span lang=\"EN-US\">6</span>日，在万达广场搭建半场篮球场，安装一个篮球架，铺设塑胶篮球场地，设置围栏；搭建主背景墙；设置道旗等宣传物料、指示牌等，粘贴、悬挂各个赞助商广告板；音响、话筒安装调试。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span lang=\"EN-US\" style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">2</span><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">、人员配备：篮球教练、花式篮球教练、篮球啦啦操教练<span lang=\"EN-US\">10-15</span>人，工作人员<span lang=\"EN-US\">5</span>名，安保人员<span lang=\"EN-US\">15</span>名。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span lang=\"EN-US\" style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">3</span><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">、邀请媒体：嘉兴电视台、广播台、嘉兴日报、嘉兴在线、嘉兴<span lang=\"EN-US\">19</span>楼、第<span lang=\"EN-US\">9</span>区、网易嘉兴、腾讯大浙网等主流媒体进行报道推广。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span lang=\"EN-US\" style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">4</span><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">、印发宣传单：制作若干数量关于全民健身篮球培训宣传单，邀请市民免费参加。<span lang=\"EN-US\"><o:p></o:p></span></span></p><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-font-kerning:1.0pt;mso-ansi-language:EN-US;mso-fareast-language:ZH-CN;mso-bidi-language:AR-SA\">5</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-font-kerning:1.0pt;mso-ansi-language:EN-US;mso-fareast-language:ZH-CN;mso-bidi-language:AR-SA\">、礼品准备：采购相当数量的不同类型礼品，作为参加全民健身的礼品，免费发放给参与培训的市民朋友。</span><img src=/enrollsystem/img/ad2e0c96-c943-40e4-a609-36a0a4523b16-篮球公益课程安排.png />', 'b00b1f6a-6450-4885-a126-4b38788467c6-', '2017-08-01 12:33:28', null, '2', '32');
INSERT INTO `notice_board` VALUES ('52', '2017年嘉兴市全民健身网球公益培训方案', '<p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 31.35pt;\"><span style=\"font-size:16.0pt;font-family:黑体;mso-hansi-font-family:宋体\">一、活动背景<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">为了纪念北京奥运会成功举办，经国务院批准，自<span lang=\"EN-US\">2009</span>年起，每年<span lang=\"EN-US\">8</span>月<span lang=\"EN-US\">8</span>日为“全民健身日”。今年<span lang=\"EN-US\">8</span>月<span lang=\"EN-US\">8</span>日正值第十三届全运会举办前夕，为落实全民健身国家战略、倡导文明健康生活方式、促进全民健身与全民健康深度融合，根据嘉兴市体育局的“全民健身公益大培训”计划，特制定此次活动方案。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 31.35pt;\"><span style=\"font-size:16.0pt;font-family:黑体;mso-hansi-font-family:宋体\">二、活动主题<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">网球健身，你我同行。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 31.35pt;\"><span style=\"font-size:16.0pt;font-family:黑体;mso-hansi-font-family:宋体\">三、活动概况<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">活动时间：<span lang=\"EN-US\">2017</span>年<span lang=\"EN-US\">8</span>月<span lang=\"EN-US\">7</span>日<span lang=\"EN-US\">-8</span>月<span lang=\"EN-US\">9</span>日、<span lang=\"EN-US\">8</span>月<span lang=\"EN-US\">26</span>日；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">活动地点：嘉兴学院田径场、网球场（<span lang=\"EN-US\">7</span>日<span lang=\"EN-US\">-9</span>日）；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span lang=\"EN-US\" style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">嘉兴国际网球中心（<span lang=\"EN-US\">26</span>日）<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">主办单位：嘉兴市体育局；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">承办单位：嘉兴嘉大体育文化有限公司；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">培训内容：<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span lang=\"EN-US\" style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">&nbsp;&nbsp;&nbsp; 1</span><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">、针对初学者的普及推广培训（<span lang=\"EN-US\">7</span>日<span lang=\"EN-US\">-9</span>日），网球基本技术、网球运动概况及竞赛规则介绍等；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span lang=\"EN-US\" style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">&nbsp;&nbsp;&nbsp; 2</span><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">、具有一定网球基础的技战术能力提高培训（<span lang=\"EN-US\">26</span>日）。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 31.35pt;\"><span style=\"font-size:16.0pt;font-family:黑体;mso-hansi-font-family:宋体\">四、执行计划<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span lang=\"EN-US\" style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">1</span><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">、报名组织：通过“文化有约”平台、嘉兴市体育局微信公众号“动感禾城”等发布信息，接受市民报名。印发宣传单，制作若干数量关于全民健身网球培训宣传单，邀请市民免费参加。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span lang=\"EN-US\" style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">2</span><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">、场地器材：<span lang=\"EN-US\">8</span>月<span lang=\"EN-US\">6</span>日前，在嘉兴学院田径场搭建主背景墙；设置指示牌、安放展示板等宣传物料、布置赞助单位广告板；准备培训器材；音响、话筒安装调试。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span lang=\"EN-US\" style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">3</span><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">、人员配备：网球教练<span lang=\"EN-US\">8-10</span>人，工作人员<span lang=\"EN-US\">5</span>名，安保人员<span lang=\"EN-US\">10</span>名。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 32pt; line-height: 150%;\"><span lang=\"EN-US\" style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">4</span><span style=\"font-size:16.0pt;line-height:150%;font-family:仿宋_GB2312;mso-hansi-font-family:宋体\">、邀请媒体：嘉兴电视台、广播台、嘉兴日报、嘉兴在线等主流媒体进行报道推广。<span lang=\"EN-US\"><o:p></o:p></span></span></p><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-font-kerning:1.0pt;mso-ansi-language:EN-US;mso-fareast-language:ZH-CN;mso-bidi-language:AR-SA\">5</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:宋体;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-font-kerning:1.0pt;mso-ansi-language:EN-US;mso-fareast-language:ZH-CN;mso-bidi-language:AR-SA\">、礼品准备：采购相当数量的不同类型礼品，作为参加全民健身的礼品，免费发放给参与培训的市民朋友。</span><img src=/enrollsystem/img/3f4093e5-8d31-4fac-96f8-89401564163a-网球公益课程安排.png />', '9751e366-886f-49a0-8643-7955a455f171-', '2017-08-01 13:01:32', null, '2', '31');
INSERT INTO `notice_board` VALUES ('53', '嘉兴市第五届市民运动会网球比赛补充通知', '<p class=\"MsoNormal\" style=\"line-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">各参赛单位和市民：<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">嘉兴市第五届市民运动会网球比赛将于<span lang=\"EN-US\">2017</span>年<span lang=\"EN-US\">8</span>月至<span lang=\"EN-US\">9</span>月在嘉兴国际网球中心举行。分站赛（<span lang=\"EN-US\">8</span>月<span lang=\"EN-US\">12-13</span>日、<span lang=\"EN-US\">8</span>月<span lang=\"EN-US\">26-27</span>日），团体赛（<span lang=\"EN-US\">9</span>月<span lang=\"EN-US\">16-17</span>日），总决赛（<span lang=\"EN-US\">9</span>月<span lang=\"EN-US\">23-24</span>日）。经报主办单位同意，现将有关事项补充通知如下：<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;font-family:黑体;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">一、报到时间、地点与要求<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">（一）请各代表队和参赛市民于<a name=\"OLE_LINK3\">比赛当天上午<span lang=\"EN-US\">8:00</span></a>前到嘉兴国际网球中心</span><span style=\"font-size: 16pt; font-family: 仿宋_GB2312; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">签到，<span lang=\"EN-US\">8:30</span>开始比赛。大会不安排食宿，签到时可预购比赛当天的午餐，每人每餐<span lang=\"EN-US\">30</span>元。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">（二）报到时请各代表队交验本人二代身份证原件、有资质的医疗单位出具的运动员体检健康证明、运动员意外伤害保险单复印件。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;font-family:黑体;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">二、竞赛组别<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312;color:black\">1.</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312;color:black\">单项赛<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312;color:black\">（<span lang=\"EN-US\">1</span>）男子单打<span lang=\"EN-US\">&nbsp;</span>公开组<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312;color:black\">（<span lang=\"EN-US\">2</span>）男子双打<span lang=\"EN-US\">&nbsp;80</span>周岁以上组<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312;color:black\">（<span lang=\"EN-US\">3</span>）男子双打<span lang=\"EN-US\">&nbsp;100</span>周岁以上组<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312;color:black\">（<span lang=\"EN-US\">4</span>）女子单打<span lang=\"EN-US\">&nbsp;</span>公开组<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312;color:black\">（<span lang=\"EN-US\">5</span>）女子双打<span lang=\"EN-US\">&nbsp;80</span>周岁以上组<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312;color:black\">2.</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312;color:black\">团体赛<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312;color:black\">（<span lang=\"EN-US\">1</span>）男子：单打（不设年龄限制）<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312;color:black\">（<span lang=\"EN-US\">2</span>）女子：单打（不设年龄限制）<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312;color:black\">（<span lang=\"EN-US\">3</span>）男子双打：<span lang=\"EN-US\">80</span>周岁以上组<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312;color:black\">（<span lang=\"EN-US\">4</span>）女子双打：<span lang=\"EN-US\">80</span>周岁以上组<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312;color:black\">（<span lang=\"EN-US\">5</span>）混双或男双：女子<span lang=\"EN-US\">35</span>岁以上（<span lang=\"EN-US\">1982</span>年<span lang=\"EN-US\">12</span>月<span lang=\"EN-US\">31</span>日以前出生）或者男子</span><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312\">50</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312\">岁以上（<span lang=\"EN-US\">1968</span>年<span lang=\"EN-US\">12</span>月<span lang=\"EN-US\">31</span>日以前<span style=\"color:black\">出生）<span lang=\"EN-US\"><o:p></o:p></span></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;font-family:黑体;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">三、赛程安排</span><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">8</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">月<span lang=\"EN-US\">12-13</span>日分站赛全天比赛；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">9</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">月<span lang=\"EN-US\">26-27</span>日分站赛全天比赛；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">9</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">月<span lang=\"EN-US\">16-17</span>日团体赛全天比赛；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">9</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">月<span lang=\"EN-US\">23</span>日总决赛全天比赛；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">9</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">月<span lang=\"EN-US\">24</span>日决赛、颁奖、闭幕。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;font-family:黑体;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">四、录取名次与奖励<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">（一）各单项均录取前八名。如参赛人数不足录取名次数时，按实际参赛数录取名次。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">（二）各项目参加比赛的队数不足<span lang=\"EN-US\">3</span>队（人）时，取消该项目比赛。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">（三）获得前三名的团体和单项，颁发奖杯；获得前八名的团体和单项，授予证书。</span><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋_GB2312;mso-bidi-font-family:仿宋_GB2312;color:black\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;font-family:黑体;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">五、报名与报到<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">各代表队或个人于比赛前<span lang=\"EN-US\">10</span>天通过以下方式报名。网页报名：<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">http://coin.allelink.com.cn/wechat/pc_webcenter/index.html</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">。手机端报名：请关注动感禾城微信公众号<span lang=\"EN-US\">-</span>赛事管理<span lang=\"EN-US\">-</span>群众赛事。 报名后，运动员名单不得更改，不得无故弃权。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;font-family:黑体;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">六、联系人<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">竞赛联系人：朱佳萍，电话：<span lang=\"EN-US\">15757189877<o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">后勤联系人：谢陈娇，电话：<span lang=\"EN-US\">18358342395<o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">嘉兴国际网球俱乐部有限公司<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:32.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2017</span><span style=\"font-size:16.0pt;font-family:仿宋_GB2312;mso-hansi-font-family:仿宋;mso-font-kerning:0pt\">年<span lang=\"EN-US\">7</span>月<span lang=\"EN-US\">14</span>日<span lang=\"EN-US\"><o:p></o:p></span></span></p>', '117ce894-f3d1-4c38-aefe-2626e9facfc9-', '2017-08-21 15:15:35', null, '3', '27');
INSERT INTO `notice_board` VALUES ('54', '嘉兴市第五届市民运动会青少年俱乐部业余网球比赛 补充通知', '<p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:125%\"><span style=\"font-size:15.0pt;line-height:125%;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">各参赛单位：<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:125%\"><span lang=\"EN-US\" style=\"font-size:15.0pt;line-height:125%;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">2017</span><span style=\"font-size:15.0pt;line-height:125%;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">嘉兴市青少年体育俱乐部联赛少儿业余网球比赛将于<span lang=\"EN-US\">9</span>月<span lang=\"EN-US\">8</span>日至<span lang=\"EN-US\">10</span>日在嘉兴国际网球中心举行。经报主办单位同意，现将有关事项补充通知如下：<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.1pt;mso-char-indent-count:2.0\"><b><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">一、报到时间、地点与要求</span></b><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:125%\"><span style=\"font-size:15.0pt;line-height:125%;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">（一）运动队报到时间、地点：<span lang=\"EN-US\">9</span>月<span lang=\"EN-US\">9</span>日，上午<span lang=\"EN-US\">8</span>：<span lang=\"EN-US\">30</span>前，嘉兴国际网球中心休闲吧。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:125%\"><span style=\"font-size:15.0pt;line-height:125%;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">裁判员报到时间、地点：<span lang=\"EN-US\">9</span>月<span lang=\"EN-US\">8</span>日，下午<span lang=\"EN-US\">13</span>：<span lang=\"EN-US\">00</span>前，嘉兴国际网球中心休闲吧。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:125%\"><span style=\"font-size:15.0pt;line-height:125%;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">（二）大会不安排食宿，各代表队请于报到时预购比赛当天的午餐，每人每餐<span lang=\"EN-US\">30</span>元。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">（三）报到时请各代表队交验运动员本人二代身份证原件、学校学籍证明或俱乐部会员证明、有资质的医疗单位出具的运动员健康证明、赛事期间的运动员意外伤害保险单复印件和自愿参赛责任书。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"margin-left:66.1pt;text-indent:-36.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">二、<span style=\"font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;</span></span><!--[endif]--><b><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">竞赛安排</span></b><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0\"><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">9</span><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">月<span lang=\"EN-US\">8</span>日下午<span lang=\"EN-US\">13</span>：<span lang=\"EN-US\">00</span>裁判培训与裁判员会议，<span lang=\"EN-US\">15</span>：<span lang=\"EN-US\">00</span>领队教练会议，抽签。<span lang=\"EN-US\">&nbsp;<o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">9</span><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">月<span lang=\"EN-US\">9</span>日全天比赛<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">9</span><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">月<span lang=\"EN-US\">10</span>日全天比赛；颁奖。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">根据实际报名情况，若有调整，请各代表队领队教练加入<span lang=\"EN-US\">QQ</span>群<span lang=\"EN-US\">549883521</span>进行了解赛事情况。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"margin-left:66.1pt;text-indent:-36.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><b><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">三、<span style=\"font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\"> </span></span></b><!--[endif]--><b><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">报名渠道<span lang=\"EN-US\"><o:p></o:p></span></span></b></p><p class=\"MsoNormal\" style=\"margin-left:30.1pt\"><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">请各参赛队于<span lang=\"EN-US\">9</span>月<span lang=\"EN-US\">1</span>日前进行报名。网页报名：<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:29.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">http://coin.allelink.com.cn/wechat/pc_webcenter/index.html</span><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">。手机端报名：请关注动感禾城微信公众号<span lang=\"EN-US\">-</span>赛事管理<span lang=\"EN-US\">-</span>群众赛事。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.1pt;mso-char-indent-count:2.0;line-height:27.0pt;mso-line-height-rule:exactly\"><b><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">四、联系人<span lang=\"EN-US\"><o:p></o:p></span></span></b></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:27.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">竞赛联系人：朱佳萍<span style=\"color:black\">，电话：<span lang=\"EN-US\">15757189877<o:p></o:p></span></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:27.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">后勤联系人：谢陈娇，电话：<span lang=\"EN-US\">18358342395 <o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:27.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:30.0pt;mso-char-indent-count:2.0;line-height:27.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:195.0pt;mso-char-indent-count:13.0\"><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">嘉兴国际网球俱乐部有限公司<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2017</span><span style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体;mso-font-kerning:0pt\">年<span lang=\"EN-US\">7</span>月<span lang=\"EN-US\">11</span>日</span><span lang=\"EN-US\" style=\"font-size:15.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>', '009cfc3b-42ac-429e-b369-492cfdba7724-', '2017-08-21 15:34:15', null, '1', '14');
INSERT INTO `notice_board` VALUES ('55', '2017年嘉兴市第五届市民运动会国际象棋比赛补充通知', '<p class=\"MsoNormal\" style=\"text-indent:30.0000pt;mso-char-indent-count:2.0000;line-height:125%;\"><span style=\"mso-spacerun:\'yes\';font-family:宋体;line-height:125%;font-size:15.0000pt;mso-font-kerning:0.0000pt;\">各参赛单位：</span><span style=\"mso-spacerun:\'yes\';font-family:宋体;line-height:125%;font-size:15.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0000pt;mso-char-indent-count:2.0000;line-height:125%;\"><span style=\"mso-spacerun:\'yes\';font-family:宋体;line-height:125%;font-size:15.0000pt;mso-font-kerning:0.0000pt;\">2017 年嘉兴市第五届市民运会国际象棋比赛将在秀城实验教育集团钧儒小学举行。经报主办单位同意，现将有关事项补充通知如下：</span><span style=\"mso-spacerun:\'yes\';font-family:宋体;line-height:125%;font-size:15.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:30.1000pt;mso-char-indent-count:2.0000;\"><b><span style=\"font-family: 宋体; font-size: 15pt;\">一、报到时间、地点与要求</span></b><span style=\"mso-spacerun:\'yes\';font-family:宋体;font-size:15.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0000pt;mso-char-indent-count:2.0000;line-height:125%;\"><span style=\"mso-spacerun:\'yes\';font-family:宋体;line-height:125%;font-size:15.0000pt;mso-font-kerning:0.0000pt;\"><font face=\"宋体\">（一）运动队、运动员报到时间、地点：</font>9月23日上午8：00嘉兴市秀城实验教育集团钧儒小学（泾水路132号）</span><span style=\"mso-spacerun:\'yes\';font-family:宋体;line-height:125%;font-size:15.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0000pt;mso-char-indent-count:2.0000;line-height:29.0000pt;mso-line-height-rule:exactly;\"><span style=\"mso-spacerun:\'yes\';font-family:宋体;font-size:15.0000pt;mso-font-kerning:0.0000pt;\"><font face=\"宋体\">（二）大会不安排住宿，签到时可预购比赛当天的午餐，每人每餐</font>30元。</span><span style=\"mso-spacerun:\'yes\';font-family:宋体;font-size:15.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:30.0000pt;mso-char-indent-count:2.0000;\"><span style=\"mso-spacerun:\'yes\';font-family:宋体;font-size:15.0000pt;mso-font-kerning:0.0000pt;\"><font face=\"宋体\">（三）报到时请各代表队交验有资质的医疗单位出具的运动员健康证明、赛事期间的运动员意外伤害保险证明。</font> </span><span style=\"mso-spacerun:\'yes\';font-family:宋体;font-size:15.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:66.1000pt;text-indent:-36.0000pt;mso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:宋体;font-weight:bold;font-size:15.0000pt;mso-font-kerning:0.0000pt;\">二、&nbsp;</span><!--[endif]--><b><span style=\"font-family: 宋体; font-size: 15pt;\">会议安排</span></b><b><span style=\"font-family: 宋体; font-size: 15pt;\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-indent:30.0000pt;mso-char-indent-count:2.0000;line-height:29.0000pt;mso-line-height-rule:exactly;\"><span style=\"mso-spacerun:\'yes\';font-family:宋体;font-size:15.0000pt;mso-font-kerning:0.0000pt;\"><font face=\"宋体\">定于</font>9月 18 日下午 四点 召开裁判长、领队、教练联席会议，会议地点：嘉兴市秀城实验教育集团钧儒小学（泾水路132号） ，请裁判长、各代表队领队、教练准时参加。</span><span style=\"mso-spacerun:\'yes\';font-family:宋体;font-size:15.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:66.1000pt;text-indent:-36.0000pt;mso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:宋体;font-weight:bold;font-size:15.0000pt;mso-font-kerning:0.0000pt;\">三、&nbsp;</span><!--[endif]--><b><span style=\"font-family: 宋体; font-size: 15pt;\">竞赛安排</span></b><span style=\"mso-spacerun:\'yes\';font-family:黑体;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:30.1000pt;\"><span style=\"mso-spacerun:\'yes\';font-family:黑体;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;font-size:16.0000pt;mso-font-kerning:0.0000pt;\">9月22日周五9:00-11:30裁判员学习规则</span><span style=\"mso-spacerun:\'yes\';font-family:黑体;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:30.1000pt;\"><span style=\"mso-spacerun:\'yes\';font-family:黑体;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;font-size:16.0000pt;mso-font-kerning:0.0000pt;\">9月22日周五14:00-16:00布置场地</span><span style=\"mso-spacerun:\'yes\';font-family:黑体;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:30.1000pt;\"><span style=\"mso-spacerun:\'yes\';font-family:黑体;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;font-size:16.0000pt;mso-font-kerning:0.0000pt;\">9月23日周六8:30-16:30比赛</span><span style=\"mso-spacerun:\'yes\';font-family:黑体;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:30.1000pt;\"><span style=\"mso-spacerun:\'yes\';font-family:黑体;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;font-size:16.0000pt;mso-font-kerning:0.0000pt;\">9月24日周日8:30-16:30比赛</span><span style=\"mso-spacerun:\'yes\';font-family:黑体;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;font-size:16.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:30.1000pt;\"><span style=\"mso-spacerun:\'yes\';font-family:黑体;mso-hansi-font-family:宋体;mso-bidi-font-family:宋体;font-size:16.0000pt;mso-font-kerning:0.0000pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:30.0000pt;mso-char-indent-count:2.0000;line-height:27.0000pt;mso-line-height-rule:exactly;\"><span style=\"mso-spacerun:\'yes\';font-family:宋体;font-size:15.0000pt;mso-font-kerning:0.0000pt;\">竞赛联系人：</span><span style=\"mso-spacerun:\'yes\';font-family:宋体;color:rgb(0,0,0);font-size:15.0000pt;mso-font-kerning:0.0000pt;\">&nbsp;<font face=\"宋体\">刘老师</font> &nbsp;&nbsp;<font 