INSERT INTO `notice_board` VALUES ('56', '嘉兴市第五届市民运动会国际象棋比赛竞赛规程', '<p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">一、竞赛日期和地点</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">2017</span><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">年<span lang=\"EN-US\">6</span>月中旬，嘉兴市秀城实验教育集团钧儒小学举行。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">二、组织机构</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:26.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">主办单位：嘉兴市市民运动会组委会</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:26.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">承办单位：嘉兴市棋类运动协会</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">三、参赛对象</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">各县（市、区）组、单项体育协会、俱乐部、市属单位和大专院校以及市民自愿报名参赛。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">四、比赛项目</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（一）成年组：男、女个人团体</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（二）大学生组：男、女个人团体</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（三）青少年甲组：男、女个人团体</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（四）青少年乙组：男、女个人团体</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（五）儿童甲组：男、女个人团体</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（六）儿童乙组：男、女个人团体</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">五、运动员资格</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">凡在我市生活、工作和学习，且身体健康的市民，均可自愿报名参赛。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">六、参加办法</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:23.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">各代表队可报领队、教练各<span lang=\"EN-US\">1</span>人，参赛运动员人数不限；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">七、竞赛办法</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:18.0pt;mso-char-indent-count:1.5;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（一）竞赛组别</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">1.</span><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">成年组：<span lang=\"EN-US\">1999</span>年<span lang=\"EN-US\">12</span>月<span lang=\"EN-US\">31</span>日以前出生者，</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">2.</span><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">大学生组：本市高校就读学生，</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">3.</span><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">青少年甲组：<span lang=\"EN-US\">2001</span>年<span lang=\"EN-US\">1</span>月<span lang=\"EN-US\">1</span>日至<span lang=\"EN-US\">2004</span>年<span lang=\"EN-US\">12</span>月<span lang=\"EN-US\">31</span>日出生，</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">4.</span><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">青少年乙组：<span lang=\"EN-US\">2005</span>年<span lang=\"EN-US\">1</span>月<span lang=\"EN-US\">1</span>日至<span lang=\"EN-US\">2006</span>年<span lang=\"EN-US\">12</span>月<span lang=\"EN-US\">31</span>日出生，</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">5.</span><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">儿童甲组：<span lang=\"EN-US\">2007</span>年<span lang=\"EN-US\">1</span>月<span lang=\"EN-US\">1</span>日至<span lang=\"EN-US\">2008</span>年<span lang=\"EN-US\">12</span>月<span lang=\"EN-US\">31</span>日出生，</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">6.</span><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">儿童乙组：<span lang=\"EN-US\">2009</span>年<span lang=\"EN-US\">1</span>月<span lang=\"EN-US\">1</span>日以后出生。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:12.0pt;mso-char-indent-count:1.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（二）比赛执行中国国际象棋协会审定<span lang=\"EN-US\">2016</span>年版《国际象棋竞赛工作手册》。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:12.0pt;mso-char-indent-count:1.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（三）比赛均采用瑞士制，比赛轮数视报名情况另定。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:12.0pt;mso-char-indent-count:1.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（四）比赛时限均为每方<span lang=\"EN-US\">30</span>分钟每步加<span lang=\"EN-US\">10</span>秒。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:12.0pt;mso-char-indent-count:1.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（五）名次区分<span lang=\"EN-US\">:</span>按积分排列名次、如相同则依次比较直胜、对手分、中间对手分、积分逆减。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 12pt;\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（六）团体名次以各组同单位的<span lang=\"EN-US\">2</span>男<span lang=\"EN-US\">1</span>女<span lang=\"EN-US\">3</span>名运动员组成团体，以<span lang=\"EN-US\">3</span>名队员个人名次分相加计算团体成绩，得分少者名次列前。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">八、录取名次与奖励</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" align=\"left\" style=\"text-indent: 12pt;\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（一）各组男、女分别录取前八名、团体录取前六名，参赛人（队）数不足八人（队）的，按实际参赛人（队）数录取。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:12.0pt;mso-char-indent-count:1.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（二）取得名次的团体、个人予以颁发奖牌和证书。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">九、报名与报到</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（一）各代表队或个人于比赛前<span lang=\"EN-US\">20</span>天进入嘉兴市市民运动会官网（<span lang=\"EN-US\">http://smydh.jxty.gov.cn/</span>）或微信设立的专用报名通道进行报名，逾期报名的视为放弃。报名后，运动员名单不得更改，不得无故弃权。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:12.0pt;mso-char-indent-count:1.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（二）各竞赛项目报名人（队）数不足<span lang=\"EN-US\">3</span>人（队）时，不含<span lang=\"EN-US\">3</span>人（队），取消该项目比赛。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:12.0pt;mso-char-indent-count:1.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（三）报到时应交验本人二代身份证原件、有资质的医疗单位出具的运动员体检健康证明、运动员意外伤害保险单复印件。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">十、裁判员</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">总裁判长和编排主裁判由市体育局选派<span lang=\"EN-US\">,</span>其他裁判员由承办单位选聘。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">十一、参赛经费自理，参赛队必须签订《自愿参加比赛责任书》，自行办理人身意外伤害保险。组委会统一安排购买比赛公众责任险。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">十二、本竞赛规程的解释权和修改权属嘉兴市市民运动会组委会。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-hansi-font-family:Calibri;mso-bidi-font-family:方正仿宋_GBK;mso-font-kerning:1.0pt;mso-ansi-language:EN-US;mso-fareast-language:ZH-CN;mso-bidi-language:AR-SA\">&nbsp; &nbsp; 十三、未尽事宜由承办单位另行通知。</span>', 'b3a5e2e7-9e69-42af-aac4-33eeba5ad3af-', '2017-08-29 09:34:51', null, '2', '30');
INSERT INTO `notice_board` VALUES ('57', '嘉兴市第五届市民运动会青少年俱乐部 业余网球比赛竞赛规程', '<p class=\"MsoPlainText\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:27.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-hansi-font-family:Calibri;mso-bidi-font-family:方正仿宋_GBK\">一、竞赛日期和地点</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-hansi-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoPlainText\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:27.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-hansi-font-family:Calibri;mso-bidi-font-family:方正仿宋_GBK\">2017</span><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-hansi-font-family:Calibri;mso-bidi-font-family:方正仿宋_GBK\">年<span lang=\"EN-US\">7</span>月<span lang=\"EN-US\">7</span>日<span lang=\"EN-US\">-9</span>日举行，比赛地点另定。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-hansi-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoPlainText\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:150%\"><span style=\"font-size:12.0pt;line-height:150%;font-family:方正仿宋_GBK;mso-hansi-font-family:Calibri;mso-bidi-font-family:方正仿宋_GBK\">二、组织机构</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:150%;font-family:方正仿宋_GBK;mso-hansi-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:26.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">主办单位：嘉兴市市民运动会组委会</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoPlainText\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:27.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-hansi-font-family:Calibri;mso-bidi-font-family:方正仿宋_GBK\">承办单位：嘉兴市体育局、嘉兴市教育局<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoPlainText\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:27.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-hansi-font-family:Calibri;mso-bidi-font-family:方正仿宋_GBK\">协办单位：政府购买服务中标单位</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-hansi-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">三、参赛对象</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">各县（市、区）组、各青少年体育俱乐部、学校、幼儿园、青少年宫、培训中心均可组队报名参赛。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">四、竞赛项目及组别</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（一）竞赛组别</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">1</span><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">、青年组</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">2</span><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">、少年组</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（二）竞赛项目</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">团体赛</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:0cm;text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（1）</span><!--[endif]--><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">男子：单打</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:0cm;text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（2）</span><!--[endif]--><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">女子：单打</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:0cm;text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（3）</span><!--[endif]--><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">男子双打</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:0cm;text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（4）</span><!--[endif]--><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">女子双打</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">五、参赛办法</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（一）青年组为高中生或<span lang=\"EN-US\">18 </span>周岁以下者；少年组为初中生或<span lang=\"EN-US\">15 </span>周岁以下者。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（二）各项目各组别限报一支代表队。每个代表队限报领队<span lang=\"EN-US\">1</span>名、教练员<span lang=\"EN-US\">1</span>人，运动员每队每组别可报<span lang=\"EN-US\">4</span>男<span lang=\"EN-US\">4</span>女共<span lang=\"EN-US\">8</span>人。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（三）每位运动员最多参加两项。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（四）参赛者必须具有<span lang=\"EN-US\">10</span>万元的人身意外伤害保险（包括往返途中和比赛期间）和有资质的医务部门出具身体健康证明。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（五）以学校组队参赛的运动员需以本校在校学生；以青（少）年宫、科技馆、活动中心组队参赛的选手为在本单位参加活动的学生，并提供相关证明。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">六、竞赛办法</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">参照《第五届市民运动会青少年俱乐部业余网球比赛竞赛规程》执行。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">七、录取名次与奖励</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（一）各单项设立前八名（无成绩者不予取奖）。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（二）团体成绩按各参赛队单项成绩最好的三男三女名次排名相加排列，颁发前六名奖项。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（三）团体和个人颁发获奖奖杯、奖牌和证书。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:30.0pt;mso-line-height-rule:exactly\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">八、报名与报到</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（一）各代表队或个人于比赛前<span lang=\"EN-US\">20</span>天进入嘉兴市市民运动会官网（<span lang=\"EN-US\">http://smydh.jxty.gov.cn/</span>）或微信设立的专用报名通道进行报名，逾期报名的视为放弃。报名后，运动员名单不得更改，不得无故弃权。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（二）各竞赛项目报名队数不足<span lang=\"EN-US\">3</span>队时，不含<span lang=\"EN-US\">3</span>队，取消该项目比赛。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">（三）报到时应交验的材料：</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoPlainText\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:27.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-hansi-font-family:Calibri;mso-bidi-font-family:方正仿宋_GBK\">1</span><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-hansi-font-family:Calibri;mso-bidi-font-family:方正仿宋_GBK\">、正式报名表。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-hansi-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoPlainText\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:27.0pt;mso-line-height-rule:exactly\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-hansi-font-family:Calibri;mso-bidi-font-family:方正仿宋_GBK\">2</span><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-hansi-font-family:Calibri;mso-bidi-font-family:方正仿宋_GBK\">、学生证或带照片及单位公章的学籍证明。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-hansi-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">3</span><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">、本人二代身份证原件、有资质的医疗单位出具的运动员体检健康证明、运动员意外伤害保险单复印件。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">各代表队需对上述材料的真实性负全部责任。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">九、裁判员</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;line-height:21.0pt;mso-line-height-rule:exactly;layout-grid-mode:char;mso-layout-grid-align:none\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">总裁判长和编排主裁判由市体育局选派<span lang=\"EN-US\">,</span>其他裁判员由承办单位选聘。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">十、参赛经费自理，参赛队必须签订《自愿参加比赛责任书》，自行办理人身意外伤害保险。组委会统一安排购买比赛公众责任险。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0\"><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:方正仿宋_GBK\">十一、本竞赛规程的解释权和修改权属嘉兴市市民运动会组委会。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><span style=\"font-size:12.0pt;font-family:方正仿宋_GBK;mso-hansi-font-family:Calibri;mso-bidi-font-family:方正仿宋_GBK;mso-font-kerning:1.0pt;mso-ansi-language:EN-US;mso-fareast-language:ZH-CN;mso-bidi-language:AR-SA\">&nbsp; &nbsp; 十二、未尽事宜由承办单位另行通知。</span>', '687072fe-f958-4171-8865-92b28dff3cf6-', '2017-08-29 09:37:42', null, '1', '14');
INSERT INTO `notice_board` VALUES ('58', '嘉兴市第五届市民运动会轮滑比赛竞赛规程', '一、竞赛日期和地点2016年8月，比赛地点另定。二、组织机构主办单位：嘉兴市市民运动会组委会承办单位：政府购买服务中标单位三、参赛单位各县（市、区）组、单项体育协会、俱乐部、市属单位和大专院校以及市民自愿报名参赛。四、竞赛项目（男/女组）500米争先赛、1000米计时赛五、运动员资格按照《嘉兴市第五届市民运动会竞赛规程总则》规定执行。六、参加办法（一）竞赛组别1、成年组：1999年12月31日前出生者；2、青年组：2000年1月1日至2004年12月31日出生者；3、少年组：2005年1月1日至2008年12月31日出生者；（二）每队限报领队、教练员各1人，成年组、青年组和少年组男、女运动员各3人。禁止跨年龄组参赛。（三）每队每个组别可报男、女替补运动员各1人，报到时确认正式参赛运动员，并取消替补运动员名额。（四）每位运动员可兼报2个单项比赛。（五）运动员必须办理赛事期间的意外伤害保险。七、竞赛办法（一）比赛场地为室内200米赛道，涂层地面，弯道有坡度。（二）参赛不足8人的组别，减1录取及奖励。参赛不足3人（队），取消该项目。（三）执行最新《速度轮滑竞赛规则》和国际规则最新条款。（四）各参赛单位运动员必须身着统一比赛服参赛。（五）轮滑鞋、护具等器材须适合速度轮滑竞赛的特点和需要，须佩带安全头盔。组委会有权拒绝运动员使用不安全及危险性器材参赛。八、录取名次（一）各单项竞赛取前8名；各组别团体奖排列，以全部单项比赛所获得前三名相加总数排列，总数多者列前；如获奖总数相同则第一名总数多者列前，如第一名总数相同则第二名总数多者列前，以此类推。获奖比例为30%、30%、40%。（二）参加比赛的队数不足3队时，取消该项目比赛。九、报名与报到（一）各代表队或个人于比赛前20天进入嘉兴市市民运动会官网（http://smydh.jxty.gov.cn/）或微信设立的专用报名通道进行报名，逾期报名的视为放弃。报名后，运动员名单不得更改，不得无故弃权。（二）报到时应交验本人二代身份证原件、有资质的医疗单位出具的运动员体检健康证明、运动员意外伤害保险单复印件。十、裁判员总裁判长和编排主裁判由市体育局选派,其他裁判员由承办单位选聘。十一、参赛经费自理，参赛队必须签订《自愿参加比赛责任书》，自行办理人身意外伤害保险。组委会统一安排购买比赛公众责任险。十二、本竞赛规程的解释权和修改权属嘉兴市市民运动会组委会。&amp;nbsp; &amp;nbsp; 十三、未尽事宜由承办单位另行通知。', '391e29c0-dc86-417b-ba5b-fd1dfb423938-', '2017-08-29 09:43:42', null, '1', '28');
INSERT INTO `notice_board` VALUES ('87', '热烈庆祝祖国', '<p>&nbsp;&nbsp;&nbsp;&nbsp;盼望着，盼望着，东风来了，春天的脚步近了。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;一切都像刚睡醒的样子，欣欣然张开了眼。山朗润起来了，水涨起来了，太阳的脸红起来了。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;小草偷偷地从土里钻出来，嫩嫩的，绿绿的。园子里，田野里，瞧去，一大片一大片满是的。坐着，躺着，打两个滚，踢几脚球，赛几趟跑，捉几回迷藏。风轻悄悄的，草软绵绵的。<img src=\"/MyRen/ueditor/upload/image/20171111/1510388394186004862.jpg\" title=\"1510388394186004862.jpg\" alt=\"timg.jpg\" width=\"1\" height=\"1\"/></p><p>&nbsp;&nbsp;&nbsp;&nbsp;桃树、杏树、梨树，你不让我，我不让你，都开满了花赶趟儿。红的像火，粉的像霞，白的像雪。花里带着甜味儿；闭了眼，树上仿佛已经满是桃儿、杏儿、梨儿。花下成千成百的蜜蜂嗡嗡地闹着，大小的蝴蝶飞来飞去。野花遍地是：杂样儿，有名字的，没名字的，散在草丛里，像眼睛，像星星，还眨呀眨的。</p><span class=\"edui-editor-imagescale-hand0\" style=\"box-sizing: border-box; position: absolute; width: 6px; height: 6px; overflow: hidden; font-size: 0px; display: block; background-color: rgb(60, 157, 208); cursor: nw-resize; top: 0px; margin-top: -4px; left: 0px; margin-left: -4px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\"></span><span class=\"edui-editor-imagescale-hand1\" style=\"box-sizing: border-box; position: absolute; width: 6px; height: 6px; overflow: hidden; font-size: 0px; display: block; background-color: rgb(60, 157, 208); cursor: n-resize; top: 0px; margin-top: -4px; left: 179px; margin-left: -4px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\"></span><span class=\"edui-editor-imagescale-hand2\" style=\"box-sizing: border-box; position: absolute; width: 6px; height: 6px; overflow: hidden; font-size: 0px; display: block; background-color: rgb(60, 157, 208); cursor: ne-resize; top: 0px; margin-top: -4px; left: 358px; margin-left: -3px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\"></span><p style=\"text-align: center;\"><img src=\"/MyRen/ueditor/upload/image/20171111/1510388418032040981.jpg\" title=\"1510388418032040981.jpg\" alt=\"timg.jpg\" width=\"215\" height=\"129\"/></p><p>&nbsp;&nbsp;&nbsp;&nbsp;“吹面不寒杨柳风”，不错的，像母亲的手抚摸着你。风里带来些新翻的泥土的气息，混着青草味儿，还有各种花的香，都在微微润湿的空气里酝酿。鸟儿将巢安在繁花嫩叶当中，高兴起来了，呼朋引伴地卖弄清脆的喉咙，唱出宛转的曲子，与轻风流水应和着。牛背上牧童的短笛，这时候也成天嘹亮地响着。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;雨是最寻常的，一下就是三两天。可别恼。看，像牛毛，像花针，像细丝，密密地斜织着，人家屋顶上全笼着一层薄烟。树叶儿却绿得发亮，小草儿也青得逼你的眼。傍晚时候，上灯了，一点点黄晕的光，烘托出一片安静而和平的夜。在乡下，小路上，石桥边，有撑起伞慢慢走着的人，地里还有工作的农民，披着蓑戴着笠。他们的房屋，稀稀疏疏的在雨里静默着。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;天上风筝渐渐多了，地上孩子也多了。城里乡下，家家户户，老老小小，也赶趟儿似的，一个个都出来了。舒活舒活筋骨，抖擞抖擞精神，各做各的一份事去。“一年之计在于春”，刚起头儿，有的是工夫，有的是希望。</p><p style=\"line-height: 16px;\"><img src=\"/MyRen/ueditor/dialogs/attachment/fileTypeImages/icon_doc.gif\"/><a style=\"font-size:12px; color:#0066cc;\" href=\"/MyRen/ueditor/upload/file/20171111/1510388473918071806.doc\" title=\"系统分析复习.doc\">系统分析复习.doc</a></p><p><br/></p>', null, '2017-11-11 16:21:42', null, '0', '42');
INSERT INTO `notice_board` VALUES ('90', '举重比赛开始报名', '<p>盼望着，盼望着，东风来了，春天的脚步近了。</p><p>一切都像刚睡醒的样子，欣欣然张开了眼。山朗润起来了，水涨起来了，太阳的脸红起来了。</p><p>小草偷偷地从土里钻出来，嫩嫩的，绿绿的。园子里，田野里，瞧去，一大片一大片满是的。坐着，躺着，打两个滚，踢几脚球，赛几趟跑，捉几回迷藏。风轻悄悄的，草软绵绵的。</p><p>桃树、杏树、梨树，你不让我，我不让你，都开满了花赶趟儿。红的像火，粉的像霞，白的像雪。花里带着甜味儿；闭了眼，树上仿佛已经满是桃儿、杏儿、梨儿。花下成千成百的蜜蜂嗡嗡地闹着，大小的蝴蝶飞来飞去。野花遍地是：杂样儿，有名字的，没名字的，散在草丛里，像眼睛，像星星，还眨呀眨的。</p><p style=\"text-align: center;\"><img src=\"http://10.82.82.133:8080http://10.82.82.133:8080http://10.82.82.133:8080http://10.82.82.133:8080http://10.82.82.133:8080/MyRen/ueditor/upload/image/20171112/1510451277311003240.jpg\" title=\"1510451277311003240.jpg\" alt=\"timg.jpg\" width=\"244\" height=\"144\"/></p><p>“吹面不寒杨柳风”，不错的，像母亲的手抚摸着你。风里带来些新翻的泥土的气息，混着青草味儿，还有各种花的香，都在微微润湿的空气里酝酿。鸟儿将巢安在繁花嫩叶当中，高兴起来了，呼朋引伴地卖弄清脆的喉咙，唱出宛转的曲子，与轻风流水应和着。牛背上牧童的短笛，这时候也成天嘹亮地响着。</p><p>雨是最寻常的，一下就是三两天。可别恼。看，像牛毛，像花针，像细丝，密密地斜织着，人家屋顶上全笼着一层薄烟。树叶儿却绿得发亮，小草儿也青得逼你的眼。傍晚时候，上灯了，一点点黄晕的光，烘托出一片安静而和平的夜。在乡下，小路上，石桥边，有撑起伞慢慢走着的人，地里还有工作的农民，披着蓑戴着笠。他们的房屋，稀稀疏疏的在雨里静默着。</p><p>天上风筝渐渐多了，地上孩子也多了。城里乡下，家家户户，老老小小，也赶趟儿似的，一个个都出来了。舒活舒活筋骨，抖擞抖擞精神，各做各的一份事去。“一年之计在于春”，刚起头儿，有的是工夫，有的是希望。</p><p>春天像刚落地的娃娃，从头到脚都是新的，它生长着。</p><p style=\"line-height: 16px;\"><img src=\"/MyRen/ueditor/dialogs/attachment/fileTypeImages/icon_doc.gif\"/><a style=\"font-size:12px; color:#0066cc;\" href=\"http://10.82.82.133:8080http://10.82.82.133:8080http://10.82.82.133:8080http://10.82.82.133:8080http://10.82.82.133:8080/MyRen/ueditor/upload/file/20171112/1510451340181060913.docx\" title=\"体育报名计划.docx\">体育报名计划.docx</a></p><p><br/></p>', '/MyRen/ueditor/upload/file/20171112/1510451340181060913.docx', '2017-11-12 09:49:04', '/MyRen/ueditor/upload/image/20171112/1510451277311003240.jpg', '5', '4');
